      //       <li>
      //         <a href={`mailto:${contactEmail}`}>
      //           <FaEnvelope></FaEnvelope>
      //         </a>
      //       </li>
      //       <li>
      //         <a href={socialLinks[0].url}>
      //           <FaLinkedin></FaLinkedin>
      //         </a>
      //       </li>
      //       <li>
      //         <a href={socialLinks[1].url}>
      //           <FaGithub></FaGithub>
      //         </a>
      //       </li>
      //       <li>
      //         <a href={socialLinks[2].url}>
      //           <FaCodepen></FaCodepen>
      //         </a>
      //       </li>
      //     </ul>
      // </div>

    );
}

export default Footer
